import { Calendario } from "./style";


function OrganizarSemana(diaSemana: any) {
  let domingo:any = [];
  let i:number=0;
  diaSemana.forEach((element: any) => {
    domingo[i] = <li>{element}</li>;
    i+=1;
    console.log(element);
  });
  return domingo;
}

function Card(dias: any) {
  let domingo:any;
  domingo = OrganizarSemana(dias.dias.domingo);

  console.log(domingo);

  return (
    <>
      <Calendario>
        {domingo}
      </Calendario>
    </>
  );


}

export default Card;
